import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  Nav,
} from "react-bootstrap";
import classes from "./NavigBar.module.css";
function NavigBar() {
  return (
    <div>
        <Navbar bg='light'>
            <Nav>
            <Button >Hit me</Button>
            <Navbar.Brand className={classes.bb}>Uber Eats</Navbar.Brand>
            <Nav.Item>
            <div className={classes.container} >punet</div>
            </Nav.Item>

            </Nav>

        </Navbar>


    </div>
  );
}
export default NavigBar;
